; Bitpacked segment emitter
; frames=256 w=128 h=96 bytes_per_frame=1536

    MOV R0, #0x000000    ; black colour
    MOV R1, #.PixelScreen ; base address for pixel writes
    MOV R2, #frames_data  ; pointer to packed frames
    MOV R3, #256         ; frame count
    MOV R4, #1536 ; bytes/frame
    MOV R5, #0           ; frame index

frame_loop:
    MOV R6, R5
    LSL R6, R6, #9    ; *512
    MOV R7, R6
    LSL R7, R7, #1    ; *1024
    ADD R6, R6, R7    ; *1536 -> frame offset in bytes
    ADD R6, R6, R2    ; R6 -> ptr to frame data
    MOV R10, #0       ; pixel index counter (counts pixels written)
    MOV R7, #0        ; byte index
byte_loop:
    LDRB R8, [R6]     ; load packed byte
    CMP R8, #0
    BEQ byte_skip
    MOV R9, #0x80    ; bit mask (MSB first)
bit_loop:
    AND R11, R8, R9
    CMP R11, #0
    BEQ bit_skip
    LSL R12, R10, #2   ; pixel_index * 4 (word offset)
    ADD R12, R12, R1   ; address = PixelScreen + offset
    STR R0, [R12]      ; draw black pixel
bit_skip:
    LSR R9, R9, #1
    ADD R10, R10, #1
    CMP R9, #0
    BNE bit_loop
byte_skip:
    ADD R6, R6, #1
    ADD R7, R7, #1
    CMP R7, R4
    BLT byte_loop
    ADD R5, R5, #1
    CMP R5, R3
    BLT frame_loop
    HALT

